package scatterProg;import axis.*;import dataView.*;import utils.*;import scatter.*;public class ClusterApplet extends StrengthApplet {	static final protected String X2_VALUES_PARAM = "x2Values";	static final protected String Y2_VALUES_PARAM = "y2Values";		protected DataSet readData() {		DataSet data = readCoreData();				data.addNumVariable("y2", getParameter(Y_VAR_NAME_PARAM), getParameter(Y2_VALUES_PARAM));		data.addNumVariable("x2", getParameter(X_VAR_NAME_PARAM), getParameter(X2_VALUES_PARAM));				return data;	}		protected DataView createDataView(DataSet data, HorizAxis theHorizAxis, VertAxis theVertAxis) {		theView = new ScatterMoveView(data, this, theHorizAxis, theVertAxis, "x", "y", "x2", "y2");		return theView;	}		protected XChoice createChoice(DataSet data) {		return null;	}		protected String[] getSliderText() {		String text[] = {null, "clustered", null};		return text;	}		protected void changeDataType(String newParams) {	}}